DROP TABLE provincia;

CREATE TABLE IF NOT EXISTS provincia (
  id int(11),
  nombre varchar(255),
  CONSTRAINT PK_PROVINCIA_ID PRIMARY KEY(id),
  CONSTRAINT UQ_PROVINCIA_NOMBRE UNIQUE(nombre)
);


CREATE TABLE IF NOT EXISTS localidad (
  id int(11) AUTO_INCREMENT,
  idProvincia int(11),
  nombre varchar(255),
  cp varchar(255),
  CONSTRAINT PK_LOCALIDAD_ID PRIMARY KEY(id),
  CONSTRAINT FK_LOCALIDAD_PROVINCIA FOREIGN KEY (idProvincia) REFERENCES provincia(id)
);

